class BaseWindow(QMainWindow):
    def __init__(self, *args):
        super().__init__(*args)
        self.setFixedSize(1200, 400)
        self.setWindowTitle("KeyboardListener")
        pixmap = QPixmap()
        pixmap.loadFromData(icon_bytes)
        self.setWindowIcon(QIcon(pixmap))
        self.fernet = None
        self.previous_page = None
        self.next_page = None

    def read_config(self):
        with open('config.pkl', 'rb') as f:
            data = pickle.load(f)
            return data

    def write_config(self, data):
        with open('config.pkl', 'wb') as f:
            pickle.dump(data, f)

    def read_scripts(self):
        with open('scripts.pkl', 'rb') as f:
            data = pickle.load(f)
            return data

    def write_scripts(self, data):
        with open('scripts.pkl', 'wb') as f:
            pickle.dump(data, f)

    def read_presets(self):
        with open('presets.pkl', 'rb') as f:
            data = pickle.load(f)
            return data

    def write_presets(self, data):
        with open('presets.pkl', 'wb') as f:
            pickle.dump(data, f)
